// SPDX-License-Identifier: MIT
pragma solidity 0.6.12;

import "./Vaults/VaultBase.sol";
import "./Settings.sol";
import "../interfaces/IVaultBase.sol";
import "../interfaces/IUniswapV2Router02.sol";
import "./openzeppelin/contracts/math/SafeMath.sol";
import "./openzeppelin/contracts/access/Ownable.sol";
import "./openzeppelin/contracts/utils/Pausable.sol";



pragma experimental ABIEncoderV2;

contract Controller is Ownable, Pausable {
    using SafeMath for uint256;

    struct UserTokens {
        address vault;
        uint256 tokenId;
    }

    Settings public settings;


    constructor(
        address _feeAddress,
        uint256 _slippagePoints,
        uint256 _slippageBasePoints,
        address[] memory _routers
    ) public {
        settings = new Settings(_feeAddress, address(this), _slippagePoints, _slippageBasePoints, _routers);
        settings.transferOwnership(msg.sender);
    }


    function viewTrades(uint256 _vaultId, uint256 _tokenId, uint256[] memory _tradeIds) public view returns (VaultBase.Order[][] memory) {
        VaultBase _vault = VaultBase(settings.vaults(_vaultId));
        require(_tokenId <= _vault.tokenCounter(), "CornFi Vault Query: Token ID Out of Range");
        VaultBase.Order[][] memory tradeOrders = new VaultBase.Order[][](_tradeIds.length);
        for(uint i = 0; i < _tradeIds.length; i++) {
            require(_tradeIds[i] <= _vault._tokenTradeLength(_tokenId), "CornFi Vault Base: Trade ID Out of Range");
            tradeOrders[i] = _viewTrade(_vault, _tokenId, _tradeIds[i]);
        }
        return tradeOrders;
    }


    // --------------------------------------------------------------------------------
    // --------------------------------------------------------------------------------


    function viewOrders(uint256 _vaultId, uint256[] memory _orderIds) public view returns (VaultBase.Order[] memory) {
        VaultBase _vault = VaultBase(settings.vaults(_vaultId));
        VaultBase.Order[] memory _orders = new VaultBase.Order[](_orderIds.length);
        for(uint i = 0; i < _orderIds.length; i++) {
            //require(_orderIds[i] < _vault.ordersLength(), "CornFi Vault Base: Order ID Out of Range");
            _orders[i] = _vault.order(_orderIds[i]);
        }
        return _orders;
    }


    // --------------------------------------------------------------------------------
    // --------------------------------------------------------------------------------


    function viewOpenOrdersByToken(uint256 _vaultId, uint256 _tokenId) public view returns (VaultBase.Order[] memory) {
        VaultBase _vault = VaultBase(settings.vaults(_vaultId));
        //require(_tokenId <= tokenCounter, "CornFi Vault Base: Token ID Out of Range");
        uint256 orderLength = _vault.tokenOpenOrdersLength(_tokenId);
        VaultBase.Order[] memory _orders = new VaultBase.Order[](orderLength);
        for(uint i = 0; i < orderLength; i++) {
            _orders[i] = _vault.order(_vault.tokenOpenOrderId(_tokenId, i));
        }
        return _orders;
    }


    // --------------------------------------------------------------------------------
    // --------------------------------------------------------------------------------


    function viewOpenOrdersInRange(uint256 _vaultId, uint256 _start, uint256 _end) public view returns (VaultBase.Order[] memory) {
        VaultBase _vault = VaultBase(settings.vaults(_vaultId));
        require(_start <= _end, "CornFi Vault Base: Starting Index Greater Than Ending Index");
        //require(_end < openOrderIds.length, "CornFi Vault Base: End Index Out of Range");
        VaultBase.Order[] memory _orders = new VaultBase.Order[](_end.sub(_start).add(1));
        for(uint i = _start; i <= _end; i++) {
            _orders[i.sub(_start)] = _vault.order(_vault.openOrderId(i));
        }
        return _orders;
    }


    // --------------------------------------------------------------------------------
    // --------------------------------------------------------------------------------


    function ordersLength(uint256 _vaultId) public view returns (uint256) {
        VaultBase _vault = VaultBase(settings.vaults(_vaultId));
        return _vault.ordersLength();
    }


    // --------------------------------------------------------------------------------
    // --------------------------------------------------------------------------------


    function openOrdersLength(uint256 _vaultId) public view returns (uint256) {
        VaultBase _vault = VaultBase(settings.vaults(_vaultId));
        return _vault.openOrdersLength();
    }


    // --------------------------------------------------------------------------------
    // --------------------------------------------------------------------------------


    function tokenOpenOrdersLength(uint256 _vaultId, uint256 _tokenId) public view returns (uint256) {
        VaultBase _vault = VaultBase(settings.vaults(_vaultId));
        return _vault.tokenOpenOrdersLength(_tokenId);
    }


    // --------------------------------------------------------------------------------
    // --------------------------------------------------------------------------------


    function tokenLength(uint256 _vaultId) public view returns (uint256) {
        VaultBase _vault = VaultBase(settings.vaults(_vaultId));
        return _vault.tokenCounter();
    }


    // --------------------------------------------------------------------------------
    // --------------------------------------------------------------------------------


    function tokenTradeLength(uint256 _vaultId, uint256 _tokenId) public view returns (uint256) {
        VaultBase _vault = VaultBase(settings.vaults(_vaultId));
        //require(_tokenId <= tokenCounter, "CornFi Vault Base: Token ID Out of Range");
        return _vault._tokenTradeLength(_tokenId);
    }


    // --------------------------------------------------------------------------------
    // --------------------------------------------------------------------------------


    function vaultTokensByOwner(address _owner) public view returns (UserTokens[] memory) {
        uint256 tokensLength = 0;
        for(uint256 k = 0; k < settings.vaultsLength(); k++) {
            tokensLength += VaultBase(settings.vaults(k)).balanceOf(_owner);
        }

        UserTokens[] memory userTokens = new UserTokens[](tokensLength);
        uint256 counter = 0;
        for(uint256 i = 0; i < settings.vaultsLength(); i++) {
            for(uint256 j = 0; j < VaultBase(settings.vaults(i)).balanceOf(_owner); j++) {
                userTokens[counter++] = UserTokens(settings.vaults(i), VaultBase(settings.vaults(i)).tokenOfOwnerByIndex(_owner, j));
            }
        }

        return userTokens;
    }


    // --------------------------------------------------------------------------------
    // --------------------------------------------------------------------------------


    function createTrade(uint256 _vaultId, address[] memory _tokens, uint256[] memory _amounts, uint[] memory _times) public whenNotPaused {
        require(settings.vault(settings.vaults(_vaultId)), "CornFi Controller: Inactive Vault");
        IVaultBase(settings.vaults(_vaultId)).createTrade(msg.sender, _tokens, _amounts, _times);
    }


    // --------------------------------------------------------------------------------
    // --------------------------------------------------------------------------------


    function fillOrder(uint256 _vaultId, uint256 _orderId) public whenNotPaused {
        IVaultBase(settings.vaults(_vaultId)).fillOrder(msg.sender, _orderId);
    }


    // --------------------------------------------------------------------------------
    // --------------------------------------------------------------------------------


    function fillOrder(uint256 _vaultId, uint256 _orderId, IUniswapV2Router02 _router, address[] memory _path) public whenNotPaused {
        IVaultBase(settings.vaults(_vaultId)).fillOrder(msg.sender, _orderId, _router, _path);
    }


    // --------------------------------------------------------------------------------
    // --------------------------------------------------------------------------------


    function withdraw(uint256 _vaultId, uint256 _tokenId) public {
        IVaultBase(settings.vaults(_vaultId)).withdraw(msg.sender, _tokenId);
    }


    // --------------------------------------------------------------------------------
    // --------------------------------------------------------------------------------


    function setSettings(Settings _settings) public onlyOwner {
        settings = _settings;
    }


    // --------------------------------------------------------------------------------
    // --------------------------------------------------------------------------------


    function pause() public onlyOwner {
        _pause();
    }


    // --------------------------------------------------------------------------------
    // --------------------------------------------------------------------------------


    function unpause() public onlyOwner {
        _unpause();
    }


    // --------------------------------------------------------------------------------
    // --------------------------------------------------------------------------------


    function _viewTrade(VaultBase _vault, uint256 _tokenId, uint256 _tradeId) internal view returns (VaultBase.Order[] memory) {
        uint256[] memory tradeOrderIds = _vault.trade(_tokenId, _tradeId);
        VaultBase.Order[] memory tradeOrders = new VaultBase.Order[](tradeOrderIds.length);
        for(uint i = 0; i < tradeOrderIds.length; i++) {
            tradeOrders[i] = _vault.order(tradeOrderIds[i]);
        }
        return tradeOrders;
    }
}
